		"description": "<p>\r\nThis high level map of the ESnet 5 network highlights the sites\r\nESnet serves, the structure of the network and the current traffic load.  More\r\ninformation about each node and edge on the map is available by clicking on\r\nthat node or edge.\r\n</p>\r\n<p>\r\nIn order to increase the legibility of this map two simplifications have been\r\nsystematically applied.  The first simplification is that connectivity for\r\neach site is shown as a single pair of lines which show the traffic traversing\r\nall connections to the site.  This simplification means that this map does not\r\nshow the fault tolerence which has been carefully engineered to provide the\r\nsites with highly available connectivity.  An additional map is under\r\ndevelopment which will show this fault tolerence at some cost to legibility.\r\nThe second simplification is that for any pair of nodes shown there is only a\r\nsingle pair of lines representing all of the connections between that pair of\r\nnodes.  \r\n</p>",
